        "title": "Dark Matter Explained: What Exactly is Dark Matter? | A Beginner’s Guide to Dark Matter",
        "description": "Dark matter is an invisible matter that occupies more than half of the space of the observable universe but cannot be detected directly as it doesn’t interact with electromagnetic radiation, like visible light and gamma rays. One of the greatest challenges that astral scientists and researchers face before they can fully understand the universe is so-called \"dark matter.\" Originally called the ‘missing matter’, dark matter is the name given to particles that don’t absorb or emit light, making them impossible to detect through observing electromagnetic radiation.\n\nThink of it this way—how do you see or observe something in your everyday life?\nYou are able to see things because visible light, a type of electromagnetic radiation, bounces off objects around you and then reaches your eyes. All celestial bodies interact with electromagnetic radiation, including visible light, radio waves, gamma rays, and the rest. More notably, they alter the way radiation travels around them, which is how we detect far-off galaxies hiding billions upon billions of miles away.\nBut dark matter cannot be observed this way, because it doesn’t interact with electromagnetic radiation. Check out this video to learn more about dark matter, how was it first discovered and how is it detected now.\n\n#science #animation #darkmatter\n\nReferences:\nhttps://www.nap.edu/read/10079/chapter/7\nhttps://ned.ipac.caltech.edu/level5/Sept04/Rubin/paper.pdf\nhttp://luxdarkmatter.org/\nhttps://www.cns.umass.edu/news-events/news/dark-matter-god-particle-and-collisions-speed-light\n\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
